import React from 'react';
import './footer.css';
import { AppBar, BottomNavigation, Grid, Paper} from '@material-ui/core';
import { NavLink, Link } from 'react-router-dom';

function footer() {
  return (
    <div className="footer">
        <Grid container space={24}>
    		<Grid item xs={12}>
   				<Paper>sx = 12</Paper>
    		</Grid>
    	</Grid>
    </div>
  );
}

export default footer;
